import logo from './logo.svg';
import './App.css';
import Home from './Home';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom'
import LoginForm from './loginForm';


function App() {
  return (
    <Router>
    <Routes>
        <Route exact path="/home" element={<Home />} />
    </Routes>
</Router>
  );

}

export default App;
